import React from 'react';
import IconButton, {IconButtonProps } from '@mui/material/IconButton';


type SCFIconButtonProps = IconButtonProps & {
/**
* Controls if the component must be rendered
 */
 show?: boolean;
};
const SCFIconButton= ({show = true, ...muiprops}: SCFIconButtonProps) => {
    return show  ? <IconButton {...muiprops} /> : <></>;
};

export default SCFIconButton;